// Use jQuery's document ready function
$(document).ready(function() {
    const $movieListDiv = $('#movie-list'); // Cache jQuery selector

    // Function to render movie cards
    function renderMovieCards() {
        movies.forEach(movie => {
            // Create elements using jQuery
            const $movieCard = $('<div>').addClass('col'); // Bootstrap column
            const $innerCard = $('<div>').addClass('movie-card');

            const $movieImage = $('<img>')
                .attr('src', movie.image)
                .attr('alt', `${movie.title} Poster`);

            const $movieTitle = $('<h3>').text(movie.title);

            const $movieYear = $('<p>').html(`<strong>Year:</strong> ${movie.year}`);
            const $movieRating = $('<p>').html(`<strong>Rating:</strong> ${movie.rating}`);
            const $movieGenre = $('<p>').html(`<strong>Genre:</strong> ${movie.genre}`);
            const $movieSummary = $('<p>').addClass('summary').text(movie.summary);

            // Append elements to the inner card
            $innerCard.append($movieImage, $movieTitle, $movieYear, $movieRating, $movieGenre, $movieSummary);
            // Append the inner card to the Bootstrap column
            $movieCard.append($innerCard);
            // Append the column to the movie list container
            $movieListDiv.append($movieCard);
        });
    }

    // Intro splash screen logic
    // Hide the splash screen and show main content after a delay
    setTimeout(function() {
        $('#intro-splash').fadeOut(1000, function() { // Fade out for 1 second
            $(this).remove(); // Remove splash screen from DOM after fading
            $('#main-content').removeClass('d-none').hide().fadeIn(1000); // Fade in main content
            renderMovieCards(); // Render cards after main content is visible
        });
    }, 3000); // Display splash screen for 3 seconds
});